        {/*<MenuIcon/>*/}
        <img 
        className='header__logo'
        src="C:\Users\Asus\Downloads\YouTube_Logo_2017.svg" alt=""/>
       
        </div>
        <div className='input'>
        <input type='text'/>
        {/*<SearchIcon/>*/}
        </div>


        <div className='headeer__icons'>
        {/*<MenuIcon/>
        <SearchIcon/>
        <VideoCallIcon/>
        <AppsIcon/>
    <NotificationsIcon/>*/}
        </div>
        

    </div>
  )
}

export default Header
